// App.js
import './App.css';
import { Link, NavLink, useNavigate } from 'react-router-dom'; // Importa Link, NavLink y useNavigate
import Layout from './pages/Layout';
import About from './pages/About';
import Home from './pages/Home';
import Default from './pages/Default';
import Dashboard from './pages/Dashboard';
import Header from './Header';

function App() {
  const navigate = useNavigate(); // Utiliza useNavigate para cambiar de ruta

  return (
    <div>
      <Header />
      <div>
        <button onClick={() => navigate('/photos')}>Go to Photos</button>
        <button onClick={() => navigate('/home')}>Go to Home</button>
        <button onClick={() => navigate('/dashboard')}>Go to Dashboard</button>
      </div>
      <div>
        <NavLink to="/photos">Photos</NavLink>
        <NavLink to="/home">Home</NavLink>
        <NavLink to="/dashboard">Dashboard</NavLink>
      </div>
      <Layout />
      <About />
      <Home />
      <Dashboard />
      <Default />
    </div>
  );
}

export default App;
